    {
        var token = await AuthenticationUseCases.LoginAsync(userViewModel.UserName, userViewModel.Password);
        if (string.IsNullOrWhiteSpace(token))
        {
            alertComponent.ErrorMessage = "Login Failled.";
            alertComponent.Show();
        }
